import logo from './logo.svg';
import React from 'react';
import './index.css';

const courses = [
    {
       id: 0,
       name: "Website Development",
       price: "$89.999" 
    },
    {
        id: 1,
        name: "Graphics Design",
        price: "$109.999" 
     },
     {
        id: 0,
        name: "Data Analytics",
        price: "$2999.999" 
     }
];

function Arrays(props) {
  const coursesData = courses.map((course) => <li key={course.id}>
        <p>{course.name}</p>
        <span>{course.price}</span>
    </li>);
  return (
    <div className='container justify-center items-center grid'>
      <h1 className='text-green-700 text-3xl font-extrabold'>Array with key</h1>
      <ul className=' text-blue-500 font-semibold'>{coursesData}</ul>
    </div>
  );
}
export default Arrays;
